import { useState } from "react";

function AnalyzeResult(plantImg) {
  const [isOpen, setIsOpen] = useState(true);

  const closePopup = () => {
    setIsOpen(false);
  };

  return (
    <>
      {isOpen && (
        <div className="fixed inset-0 flex items-center justify-center bg-gray-900 bg-opacity-50 z-50">
          <div className="relative bg-white p-6 rounded-lg shadow-lg max-w-md w-full mx-2 flex flex-col space-y-2">
            {/* X button for closing */}
            <button
              onClick={closePopup}
              className="absolute top-2 right-2 text-gray-500 hover:text-gray-700"
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                fill="none"
                viewBox="0 0 24 24"
                strokeWidth={1.5}
                stroke="currentColor"
                className="size-6"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  d="M6 18 18 6M6 6l12 12"
                />
              </svg>
            </button>
            hey your plant has disease
            <img src={plantImg} alt="Plant Image" className="rounded-md mb-4" />
            <div className="flex flex-row">
              <img
                src={"/disease/2.JPG"}
                alt="Preview"
                className="rounded-md mb-4"
              />
              <img
                src={"/disease/3.JPG"}
                alt="Preview"
                className="rounded-md mb-4"
              />
            </div>
          </div>
        </div>
      )}
    </>
  );
}

export default AnalyzeResult;
